>\r\n  <w:LsdException Locked=\"false\" Priority=\"47\" Name=\"List Table 2 Accent 6\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"48\" Name=\"List Table 3 Accent 6\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"49\" Name=\"List Table 4 Accent 6\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 6\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"51\"\r\n   Name=\"List Table 6 Colorful Accent 6\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"52\"\r\n   Name=\"List Table 7 Colorful Accent 6\"></w:LsdException>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!--[if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\ntable.MsoNormalTable\r\n	{mso-style-name:\"Table Normal\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin:0cm;\r\n	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:12.0pt;\r\n	font-family:Calibri;\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;}\r\n</style>\r\n<![endif]--><!--StartFragment--><p class=\"MsoNormal\" style=\"text-align:justify\"> 1.          GEDUNG KANTOR<o:p></o:p>\r\n</p><p class=\"MsoNormal\" style=\"text-align: justify; line-height: 12pt;\">Gedung Kantor\r\ndifungsikan sebagai ruang kerja, penelitian dan pengkajian teknologi terbaru.\r\n	<o:p></o:p>\r\n</p><p><br>\r\n</p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:12.0pt\"> 2.  GEDUNG KERUCUT\r\n(MUSEUM)\r\n	<o:p></o:p>\r\n</p><p class=\"MsoNormal\" style=\"text-align: justify; line-height: 12pt;\">Gedung Kerucut\r\nberfungsi sebagai museum gumuk pasir. Pada Gedung Kerucut dipamerkan koleksi\r\nyang dimiliki PGSP yang meliputi tema gumuk pasir dan peralatan pemetaan masa\r\nlalu. Gedung Kerucut juga menyajikan koleksi tentang gumuk pasir, tema\r\nkepesisiran dan teknologi geospasial.\r\n	<o:p></o:p>\r\n</p><p class=\"MsoNormal\" style=\"text-align: justify; line-height: 12pt;\"><br></p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:12.0pt\"> 3.  RUANG STUDIO<o:p></o:p>\r\n</p><p class=\"MsoNormal\" style=\"text-align: justify; line-height: 12pt;\">Ruang studio\r\ndigunakan sebagai ruang pemutaran film untuk pengunjung PGSP. Ruang studio juga dapat berfungsi sebagai tempat presentasi.<o:p></o:p></p><p class=\"MsoNormal\" style=\"text-align: justify; line-height: 12pt;\"><br></p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:12.0pt\"> 4.  RUANG DIKLAT<o:p></o:p>\r\n</p><p class=\"MsoNormal\" style=\"text-align: justify; line-height: 12pt;\">Ruang diklat memiliki\r\n10 buah komputer, digunakan sebagai tempat untuk menyelenggarakan pelatihan\r\natau workshop.\r\n	<o:p></o:p>\r\n</p><p class=\"MsoNormal\" style=\"text-align: justify; line-height: 12pt;\"><br></p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:12.0pt\"> 5.  AULA<o:p></o:p>\r\n</p><p class=\"MsoNormal\" style=\"text-align: justify; line-height: 12pt;\">Aula dengan kapasitas\r\n100 orang dapat digunakan untuk acara pertemuan dan seminar.\r\n	<o:p></o:p>\r\n</p><p class=\"MsoNormal\" style=\"text-align: justify; line-height: 12pt;\"><br></p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:12.0pt\"> 6.  RUMAH SINGGAH<o:p></o:p>\r\n</p><p class=\"MsoNormal\" style=\"text-align: justify; line-height: 12pt;\">Rumah Singgah\r\nmerupakan bangunan yang berdiri hasil berkat kolaborasi dengan FGE UGM. Rumah\r\nSinggah terdiri dari GeoCamp (kapasitas 100 orang) dan RUSUNAWA (kapasitas 280\r\norang). Rumah singgah biasa digunakan untuk menginap bagi para peneliti maupun\r\nkegiatan mahasiswa di sekitar Pantai Parangtritis.\r\n</p><p class=\"MsoNormal\" style=\"text-align:justify\"><o:p></o:p>\r\n</p><!--EndFragment-->','','2015-12-15 11:36:47','3','2016-02-05 16:38:27','7');
