t-align:justify;line-height:\r\nnormal\"><span lang=\"EN-GB\">Misi Parangtritis Geomaritime\r\nScience Park adalah:<o:p></o:p></span></p><ol><li>mendorong pemanfaatan informasi geospasial\r\nuntuk pengelolaan sumberdaya kemaritiman dan kepesisiran;</li><li>meningkatkan layanan dalam penyediaan\r\ninformasi geospasial kemaritiman dan kepesisiran;</li><li>sebagai pusat pengembangan aplikasi teknologi\r\ndan informasi geospasial untuk kesejahteraan masyarakat umum dan masyarakat pesisir\r\npada khususnya;</li><li>melakukan riset kolaboratif dan melakukan komersialisasi\r\nhasil riset kolaboratif untuk meningkatkan kesejahteraan masyarakat;</li><li>meningkatkan peran\r\nmuseum gumuk pasir sebagai sarana pembelajaran.</li></ol><!--EndFragment-->','','2015-12-15 11:36:47','3','2016-02-05 15:28:11','6');
