lse\" Priority=\"48\" Name=\"List Table 3 Accent 6\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"49\" Name=\"List Table 4 Accent 6\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 6\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"51\"\r\n   Name=\"List Table 6 Colorful Accent 6\"></w:LsdException>\r\n  <w:LsdException Locked=\"false\" Priority=\"52\"\r\n   Name=\"List Table 7 Colorful Accent 6\"></w:LsdException>\r\n </w:LatentStyles>\r\n</xml><![endif]-->\r\n\r\n<!--[if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\ntable.MsoNormalTable\r\n	{mso-style-name:\"Table Normal\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin:0cm;\r\n	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:10.0pt;\r\n	font-family:Calibri;}\r\n</style>\r\n<![endif]-->\r\n\r\n\r\n\r\n<!--StartFragment-->\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:6.0pt;text-align:justify;line-height:\r\nnormal\"><span lang=\"EN-GB\">Perjalanan Parangtritis Geomaritime Science Park (PGSP) dimulai\r\npada tahun 2002. Laboratorium Geospasial Pesisir Parangtritis (LGPP) dan Museum\r\nGumuk Pasir, adalah embrio berdirinya PGSP. Laboratorium Geospasial Pesisir\r\nParangtritis direvitalisasi menjadi Parangtritis Geomaritime Science Park\r\nmengingat (1) semakin pesatnya perkembangan teknologi (2) sebagai realisasi\r\ndari program NAWACITA Jokowi di tahun 2014 serta (3) implementasi RPJMN 2015-2019.</span><span lang=\"EN-GB\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal;\"><span lang=\"EN-GB\">Parangtritis Geomaritime Science Park\r\n(PGSP) difasilitasi oleh Kementerian Riset, Teknologi dan Pendidikan Tinggi\r\n(Kemenristek Dikti) dan Pemerintah Daerah Istimewa Yogyakarta (DIY), dikelola\r\nbersama antara Badan Informasi Geospasial (BIG), Universitas Gadjah Mada (UGM),\r\nPemerintah dan Pemerintah Kabupaten Bantul. Peresmian PGSP dilakukan oleh Menristekdikti,\r\nProf. H. Mohamad Nasir, Ph.D., Ak. bersama dengan Gubernur DIY, Kepala BIG, Pj.\r\nBupati Bantul dan Rektor UGM pada tanggal 11 September 2015.<o:p></o:p></span></p>\r\n\r\n<!--EndFragment-->','','2015-12-28 23:39:45','1','2016-02-05 15:24:25','6');
